import React, { useState } from 'react';


const PlanList = () => {
  // Ï∂îÏ≤úÎì§
  const aiDataPool = {
    exercises: [
      { text: 'Îü¨Îãù 20Î∂Ñ', detail: 'Ïú†ÏÇ∞ÏÜåÎ°ú ÏÇ¥ ÎπºÏûê' },
      { text: 'Ïä§ÏøºÌä∏ 3ÏÑ∏Ìä∏', detail: 'ÌïòÏ≤¥!.' },
      { text: 'ÏöîÍ∞Ä Ïä§Ìä∏Î†àÏπ≠', detail: 'Î™∏ÏùÑ Îã§Ïãú Ï†ïÎ†¨.' },
      { text: 'Í≥ÑÎã® Ïò§Î•¥Í∏∞', detail: 'ÏàòÎ™Ö ÎäòÎ¶¨Ïûê.' },
      { text: 'Ìó¨Ïä§Ïû•', detail: 'Í∑ºÏú°!.' }
    ],
    supplements: [
      { text: 'ÎπÑÌÉÄÎØº D', detail: 'ÌïÑÏàò.' },
      { text: 'ÎßàÍ∑∏ÎÑ§Ïäò', detail: 'Îàà Îñ®Î¶º Î∞©ÏßÄÌïòÏûê.' },
      { text: 'Ïú†ÏÇ∞Í∑†', detail: 'Ïû• Í±¥Í∞ï!' },
      { text: 'Ïò§Î©îÍ∞Ä 3', detail: 'ÌòàÎãπ Í∞úÏÑ†Ïóê ÎèÑÏõÄÏùÑ Ï§çÎãàÎã§.' }
    ],
    sleep: [
      { text: '7ÏãúÍ∞Ñ Ïù¥ÏÉÅ', detail: 'Ïò§ÎäòÏùÄ Îπ®Î¶¨.' },
      { text: 'ÎÇÆÏû† 20Î∂Ñ', detail: 'ÌîºÎ°ú ÌöåÎ≥µÏù¥ ÌïÑÏöî.' },
      { text: '11Ïãú Ï∑®Ïπ®', detail: 'ÌÇ§ ÌÅ¨Ïûê.' }
    ]
  };

  // ÌòÑÏû¨ ÌôîÎ©¥Ïóê Î≥¥Ïó¨Ï§Ñ Îç∞Ïù¥ÌÑ∞ ÏÉÅÌÉú
  const [plans, setPlans] = useState([
    { id: 1, icon: 'üí™', title: 'Ï∂îÏ≤ú ÌôúÎèô', desc: 'Ï∂îÏ≤úÏ§ë..' },
    { id: 2, icon: 'üíä', title: 'Ï∂îÏ≤ú ÏòÅÏñë', desc: 'Ï∂îÏ≤úÏ§ë..' },
    { id: 3, icon: 'üí§', title: 'Ï∂îÏ≤ú ÏàòÎ©¥ÏãúÍ∞Ñ', desc: 'Ï∂îÏ≤úÏ§ë..' },
  ]);

  const [isLoading, setIsLoading] = useState(false);

  // 3. "AI Î∂ÑÏÑù" Î≤ÑÌäºÏùÑ ÎàåÎ†ÄÏùÑ Îïå Ïã§ÌñâÎêòÎäî Ìï®Ïàò
  const handleAiRefresh = () => {
    setIsLoading(true); // Î°úÎî©

    setTimeout(() => {
      // ÌïòÎÇòÏî© ÎΩëÍ∏∞
      const randomExercise = aiDataPool.exercises[Math.floor(Math.random() * aiDataPool.exercises.length)];
      const randomSupple = aiDataPool.supplements[Math.floor(Math.random() * aiDataPool.supplements.length)];
      const randomSleep = aiDataPool.sleep[Math.floor(Math.random() * aiDataPool.sleep.length)];

      setPlans([
        { id: 1, icon: 'üí™', title: 'Ï∂îÏ≤ú ÌôúÎèô : ' + randomExercise.text, desc: randomExercise.detail },
        { id: 2, icon: 'üíä', title: 'Ï∂îÏ≤ú ÏòÅÏñë : ' + randomSupple.text, desc: randomSupple.detail },
        { id: 3, icon: 'üí§', title: 'Ï∂îÏ≤ú ÏàòÎ©¥ÏãúÍ∞Ñ : ' + randomSleep.text, desc: randomSleep.detail },
      ]);
      
      setIsLoading(false); // Î°úÎî© ÎÅù
    }, 800);
  };

  return (
    <div className="card" style={{
      height: '100%', padding: '24px', boxSizing: 'border-box', 
      background: 'white', borderRadius: '16px', display: 'flex', flexDirection: 'column'
    }}>
      <div style={{display:'flex', justifyContent:'space-between', alignItems:'center', marginBottom: '15px'}}>
        <h3 style={{margin: 0}}>Ïò§ÎäòÏùò PLAN</h3>
        
        {/* ÏÉàÎ°úÍ≥†Ïπ® Î≤ÑÌäº */}
        <button 
          onClick={handleAiRefresh}
          style={{
            fontSize:'0.8rem', background: '#F2F2F2', 
            color: '#333', border:'none', borderRadius:'20px', 
            padding: '6px 12px', cursor:'pointer', fontWeight: 'bold',
            display: 'flex', alignItems: 'center', gap: '5px'
          }}
        >
          {isLoading ? 'Î∂ÑÏÑù' : 'Ïû¨Ï∂îÏ≤ú'}
        </button>
      </div>

      <ul style={{
        listStyle: 'none', padding: 0, margin: 0, flex: 1, 
        display: 'flex', flexDirection: 'column', gap: '12px'
      }}>
        {plans.map((plan) => (
          <li key={plan.id} style={{
            background: '#F8F9FA', borderRadius: '12px', padding: '16px',
            display: 'flex', alignItems: 'center', gap: '15px',
            transition: 'all 0.3s ease', 
            opacity: isLoading ? 0.5 : 1 
          }}>
            <span style={{fontSize: '1.8rem'}}>{plan.icon}</span>
            <div>
              <strong style={{fontSize: '0.95rem', display: 'block', marginBottom: '4px'}}>{plan.title}</strong>
              <div style={{fontSize: '0.85rem', color: '#666'}}>{plan.desc}</div>
            </div>
            
            {/* ÏôÑÎ£å Ï≤¥ÌÅ¨Î∞ïÏä§ */}
            <div style={{marginLeft: 'auto'}}>
              <input type="checkbox" style={{width: '20px', height: '20px', cursor: 'pointer', accentColor: '#298FEE'}} />
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default PlanList;
